V8:
Mənzil Tam Təmirlidir. 
Mənzildən dənizə panorama açılır. 
Yaxınlığında məktəb, bagca, aptek, market və digər iaşə obyektləri mövcuddur. 35-ci polis bolməsinin yaninda yerləşir.

Mənzilin ümumi sahəsi:
- 86 (kvadratmetrə);
- Cıxarış var.

Mənzildə:
- Qaz;
- İşıq;
- Su;
- Kombi Sistemi;
- Isti döşəmə;
- KATV çəkilib.
